INSERT INTO `gossip_menu_option` VALUES (9302, 0, 0, 'Worry no more, taunka. The Horde will save and protect you and your people, but first you must swear allegiance to the Warchief by taking the blood oath of the Horde.', 25649, 0, 0, 0, 0, NULL, 0, 0);
INSERT INTO `gossip_menu_option` VALUES (9303, 0, 0, 'For the Horde!\r\n\r\nArm yourself from the crates that surround us and report to Agmar\'s Hammer, east of here. Your first trial as a member of the Horde is to survive the journey.\r\n\r\nLok\'tar ogar!', 25655, 0, 0, 0, 0, NULL, 0, 0);
INSERT INTO `gossip_menu_option` VALUES (9304, 0, 0, 'Then repeat after me: \"Lok\'tar ogar! Victory or death - it is these words that bind me to the Horde. For they are the most sacred and fundamental of truths to any warrior of the Horde.\r\n\r\nI give my flesh and blood freely to the Warchief. I am the instrument of my Warchief\'s desire. I am a weapon of my Warchief\'s command.\r\n\r\nFrom this moment until the end of days I live and die - For the Horde!\"', 25653, 0, 0, 0, 0, NULL, 0, 0);
INSERT INTO `gossip_menu_option` VALUES (9305, 0, 0, 'Yes, taunka. Retribution is a given right of all members of the Horde.', 25651, 0, 0, 0, 0, NULL, 0, 0);
INSERT INTO `gossip_menu_option` VALUES (9307, 0, 0, 'I have something else to ask you about.', 24226, 9046, 0, 0, 0, '', 0, 0);
